import React from 'react';
import styled from 'styled-components';

const StyledCybersecurityStats = styled.div`
  text-align: center;
  margin: 20px;
  padding: 20px;
  border: 1px solid #ccc;
  border-radius: 8px;
`;

const CybersecurityStats = ({ attacksDetained, urlsBlocked, objectsNeutralized }) => {
  return (
    <StyledCybersecurityStats>
      <h2>Líder mundial en ciberseguridad</h2>
      <div>
        <p><strong>{attacksDetained}</strong> de ciberataques detenidos</p>
        <p><strong>{urlsBlocked}</strong> de URL maliciosas únicas bloqueadas</p>
        <p><strong>{objectsNeutralized}</strong> de objetos maliciosos únicos neutralizados</p>
      </div>
    </StyledCybersecurityStats>
  );
};

export default CybersecurityStats;
